import React from 'react';

export default class HedM extends React.Component {
  render() {
    return (
      <div className='hedm'>
        <div className='hedm2'>
          <div className='hedm-h1'>
            <h1>TREALOP</h1>
          </div>
          <ul>
            <li className='li2'>HOME</li>
            <li>PAGE</li>
            <li>DROPDOWN</li>
            <li>LINK TEXT</li>
            <li>LINK TEXT</li>
            <li>LINK TEXT</li>
            <li>LINK TEXT</li>
          </ul>
          <div className='select'></div>
        </div>
      </div>
    );
  }
}
